    render(){

        return(
        <div className='w-100'>
            <Navbar collapseOnSelect expand="sm" bg="light" variant="light" fixed="top" className="navbar mb-5">
                <Container>
                <Navbar.Brand className='navTitle' href="/">My_Events</Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
